css:
.timecop {
  background-color: #f4f4f4;
  overflow: auto;
}
.timecop .list-item {
  margin-top: 10px;
  margin-bottom: 10px;
}
.timecop .panels {
  display: -webkit-flex;
  -webkit-flex-direction: row;
}
.timecop .package-panel {
  display: -webkit-flex;
  -webkit-flex-direction: row;
}
.timecop .package-panel .list-group {
  overflow: hidden;
}
